import React, { useState } from 'react'
import One from './One';
const Two = () => {

  const [show,setshow]=useState();

  const toggle=()=>{

    setshow(!show);

  }
  return (
    <>
    <div className="two">
        <button onClick={toggle}>
            click to show and hide
        </button>
    </div>
    <One  data={show} />

    </>
  )
}

export default Two
